import React from "react";
import Header from "./Header";
import FishPage from "./FishPage";
import { Route, Switch } from "react-router-dom";
import FishInfo from "./FishInfo"

function App() {
  return (
    <div className="app">
      <Header />
      <Switch>
      <Route>
        <FishInfo path = "/info"/>
      </Route>
      <Route>
      <FishPage path = "/home"/>
      </Route>
      </Switch>

    </div>
  );
}

export default App;
